INSERT INTO `emulator_text` VALUES ('2', 'autogame.alert', '[center][size=large][b][u]ANIMATION AUTOMATIQUE[/u][/b] [/size][/center][center]	 [b][i][color=696969]Une nouvelle animation automatique débute ![/color][/i][/b] [/center][br]➤ Rejoins-nous chez [color=696969][b]WibboGame[/b][/color] dans le jeu [color=696969][u][b]{0}[/b][/u][/color] pour une animation automatisée ![br]➤ Rejoins nous et tente de remporter des [b]RareBoxs[/b] ainsi qu\'un [b]point au [u]TOP Gamer[/u][/b] ![br][br][center][img]https://cdn.wibbo.org/uploads/1659791208.png[/img]  - Jack et Daisy, [b][u][color=696969]Animateurs robotisés[/color][/u][/b]   -  [img]https://cdn.wibbo.org/uploads/1659791188.png[/img][/center]', '', '');
INSERT INTO `emulator_text` VALUES ('3', 'ban.toolesstime', 'Le temps d\'interdiction à la parole est en secondes et il doit être au moins de 600 secondes soit 10 minutes.\r\nPour des durées d\'interdiction prédéfinies plus spécifiques, utilisez l\'outil de modération.', 'Time to ban the word is in the second, and there must be at least 600 seconds or 10 minutes. \r\nFor periods of prohibition predefined more specific, use the tool mod.', 'Tempo para banir a palavra está no segundo, e deve haver pelo menos 600 segundos (10 minutos). \nPara os períodos de proibição predefinidos mais específico, use a ferramenta mod.');
