INSERT INTO `moderation_preset` VALUES ('1', '1', 'roommessage', 'Cet appartement n\'est pas autorisé dans Wibbo ; il sera bientôt fermé et toute personne encore à l\'intérieur sera kickée !');
INSERT INTO `moderation_preset` VALUES ('2', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Abus de la modération</font></b><br><br>Tout envoi délibérément inutile d\'appels à l\'aide aux modérateurs est interdit. Notre modération est suffisamment surchargée.');
INSERT INTO `moderation_preset` VALUES ('3', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Ventre de mobis contre de l\'argent réel</font></b><br><br>Tout vente de mobilier sur Wibbo en échange d\'argent réel sera considérée comme une faute grave et entraïnera une exclusion permanente.');
INSERT INTO `moderation_preset` VALUES ('4', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Piratage</font></b><br><br>Toute tentative de piratage d\'un de nos joueurs est interdit et est défini par un acte de s\'introduire sur un compte dans le but de modifier une information sur la base de donnée. Nous possédons un historique de chaque connexion sur un compte et nous n\'hésiterons pas à mener une enquête approfondie et d’appliquer de fortes sanctions aux malfrats.');
INSERT INTO `moderation_preset` VALUES ('5', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Fraude</font></b><br><br>Toute coopération frauduleuse avec un autre joueur dans le but d\'obtenir de façon illégitime un badge, un rare, un extra ou un légendaire constitue une violation de nos conditions générales d\'utilisations et entraînera une exclusion conjointe du site.');
INSERT INTO `moderation_preset` VALUES ('6', '0', 'message', '<b><font color=\"#ba3733\" size=\"6\">Détection de double compte</font></b><br><br>Les comptes clones crées pour abuser seront immédiatement exclus.');
INSERT INTO `moderation_preset` VALUES ('7', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Publicité</font></b><br><br>L’acte de faire de la publicité indirecte (citer un nom de rétro de façon récurrente et volontaire) sur le client, en commentaire ou sur le forum pour un autre rétro-serveur est interdit et peut être considéré comme de la publicité volontaire.');
INSERT INTO `moderation_preset` VALUES ('8', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Flood</font></b><br><br>Le flood, ou l\'envoi de messages incessant dans le but de gêner les autres joueurs, que ce soit en murmures ou non, en appart privé ou en appart public est interdit.');
INSERT INTO `moderation_preset` VALUES ('9', '1', 'message', '<b><font color=\"#ba3733\" size=\"12\">Insultes et/ou provocation</font></b><br><br>Le respect entre joueurs est de rigueur: tu ne peux pas insulter ou le rabaisser de quelque manière que ce soit. Ceci est identique envers les Staffs');
INSERT INTO `moderation_preset` VALUES ('10', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Diffamation</font></b><br><br>L\'harcèlement décrit selon ce comportement est formellement interdit : raconter des choses fausses dans le but de lui détruire sa réputation et son image de façon incessante est interdit.');
INSERT INTO `moderation_preset` VALUES ('11', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Discrimination</font></b><br><br>Les actes de discrimination de façon directe ou indirecte sont très sévèrement réprimandés. Nous ne faisons aucune impasse sur ce genre de comportement et prendrons toutes les mesures pour qu\'un joueur ne puisse pas se sentir victimisé en raison de son ethnie, de sa religion, de son orientation sexuelle ou tout autre façon d’être.');
INSERT INTO `moderation_preset` VALUES ('12', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Harcèlement</font></b><br><br>Toute remarque faite sur un élément personnel dans le strict but de rabaisser un utilisateur, sera traitée comme un acte de harcèlement et sera sévèrement sanctionné.');
INSERT INTO `moderation_preset` VALUES ('13', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Comportement sexuel</font></b><br><br>Toutes les activités sexuelles imaginables sont interdits sur Wibbo. Les discussions et comportement de ce type sont interdits dans le but de garantir à nos joueurs leur sécurité et d’écarter les individus suspects de notre plateforme.');
INSERT INTO `moderation_preset` VALUES ('14', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Demande d\'informations personnelles</font></b><br><br>Pour la sécurité de tous, l\'acte de demander des informations privées sur un autre joueur est strictement interdit et peut être sévèrement sanctionné en raison d’une éventuelle suspicion de pédophilie ou de comportements malveillants.');
INSERT INTO `moderation_preset` VALUES ('15', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Apologie au terrorisme</font></b><br><br>L’apologie au terrorisme est strictement réprimandé dans nos conditions d’utilisations. Tout acte répété de ce type entraînera une exclusion immédiate de notre serveur et fera l’objet d’un signalement auprès des autorités publiques et compétentes.');
INSERT INTO `moderation_preset` VALUES ('16', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Mission inappropriée</font></b><br><br>Toute mission ne respectant pas nos conditions d’utilisations est interdite et peut être punissable d’un bannissement.');
INSERT INTO `moderation_preset` VALUES ('22', '0', 'message', '<b><font color=\"#ba3733\" size=\"6\">Tenue inapproprié</font></b><br><br>Toute tenue jugée inappropriée sera sanctionnée. Si votre tenue reflète quoique ce soit de raciste, sexiste, homophobe, antisémite, provocant ou autre aspect jugé irrespectueux, vous serez contraint de la changer ou vous subirez des conséquences plus graves.');
INSERT INTO `moderation_preset` VALUES ('23', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Pseudonyme inapproprié</font></b><br><br>Tout pseudonyme jugé inapproprié sera sanctionné. Si votre pseudo contient des propos sexuel, provocant, insultant, raciste, sexiste, antisémite, homophobe, ou autre contenu inacceptable, vous serez obligé de le changer sous peine de sanctions plus graves');
INSERT INTO `moderation_preset` VALUES ('24', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Divulgation d\'informations personnelles</font></b><br><br>Toute divulgation d\'informations personnelles  telles que adresse email, adresse postale, IP, nom complet d\'une autre personne sans son consentement n\'est pas autorisée et sera punie automatiquement.');
INSERT INTO `moderation_preset` VALUES ('25', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Blocage de porte</font></b><br><br>Tout blocage d\'entrée, de circulation dans un jeu officiel, dans un appartement où se déroule un jeu, et autre n\'est pas permis. Cela nuit a l\'atmosphère de Wibbo et embête les utilisateurs. Merci de vous déplacez sous peine d\'être kick de l\'appartement.');
INSERT INTO `moderation_preset` VALUES ('26', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Création d’un appart interdit</font></b><br><br>Toute création de salle constituant une entrave à la Wibbo Attitude est strictement interdite et peut faire l’objet de sanctions plus importantes.');
INSERT INTO `moderation_preset` VALUES ('27', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Troll</font></b><br><br>Tout acte de troll visant à générer des polémiques ou de créer artificiellement une controverse qui focalise l\'attention aux dépens des échanges et de l\'équilibre habituel de la communauté est interdit.');
INSERT INTO `moderation_preset` VALUES ('28', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Usurpation d’identité</font></b><br><br>L’usurpation d’identité envers un utilisateur est jugé comme un acte pouvant porter de graves préjudices à la personne concernée. Nous vous conseillons de changer votre pseudonyme afin d’éviter d’éventuelles sanctions plus importantes.');
INSERT INTO `moderation_preset` VALUES ('29', '1', 'message', '<b><font color=\"#ba3733\" size=\"6\">Menaces</font></b><br><br>Toute menace faite dans le but d’effrayer un utilisateur est sévèrement réprimandé. Merci de prendre connaissance de nos conditions d’utilisations afin d’éviter toute sanction plus ou moins graves.');
